import React, { useState } from "react";


export default function Counter() {
    const [count, setCounter] = useState(0)
    return(
    <>
    <div>
        <label type="text">
            Count
        </label>
        <button width="900px" onClick={(e) => {
            setCounter(count+1)}}>
        </button>
        <label> New Value is {count}</label>
    </div>
    </>)
}
